  long[] twoLongs = new long[] {0,1,2,3,4,5};
  long[] indexLongs = new long[] {4 + 8*16}; // high bits 0b10101010101
  EliasFanoEncoder efEncVI = tstEFVI(twoLongs, indexInterval, indexLongs);
